import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import {
  FaBell,
  FaSearch,
  FaUserCircle,
  FaSignOutAlt,
} from 'react-icons/fa';

const Dashboard = () => {
  const navigate = useNavigate();

  // Simulated user data
  const [user, setUser] = useState(null);

  useEffect(() => {
    const fetchUser = async () => {
      const userData = {
        name: 'John Doe',
        email: 'john.doe@example.com',
        profilePic: 'https://via.placeholder.com/40', // Replace with real profile image
      };
      setUser(userData);
    };
    fetchUser();
  }, []);

  const handleLogout = () => {
    navigate('/logout');
  };

  const handleProfile = () => {
    navigate('/profile');
  };

  return (
    <div className="min-h-screen bg-gray-100 font-sans">
      {/* Header */}
      <header className="bg-white shadow fixed w-full z-10">
        <div className="flex justify-between items-center px-6 py-4">
          {/* Logo */}
          <div className="text-2xl font-bold text-blue-600">My Dashboard</div>
          {/* Search Bar */}
          <div className="flex items-center bg-gray-200 rounded-lg px-3 py-2 space-x-2">
            <FaSearch className="text-gray-500" />
            <input
              type="text"
              placeholder="Search..."
              className="bg-transparent outline-none text-sm w-60"
            />
          </div>
          {/* Actions */}
          <div className="flex items-center space-x-6">
            <FaBell className="text-gray-600 text-xl cursor-pointer" />
            {user && (
              <div className="relative">
                {/* User Profile */}
                <div className="flex items-center space-x-2 cursor-pointer" onClick={handleProfile}>
                  <img
                    src={user.profilePic}
                    alt="Profile"
                    className="w-8 h-8 rounded-full"
                  />
                  <span className="text-sm font-medium text-gray-700">
                    {user.name}
                  </span>
                </div>
                {/* Dropdown */}
                <div className="absolute top-12 right-0 w-48 bg-white shadow-lg rounded-lg hidden group-hover:block">
                  <button
                    onClick={handleLogout}
                    className="block w-full text-left px-4 py-2 text-gray-700 hover:bg-gray-100"
                  >
                    <FaSignOutAlt className="inline mr-2 text-red-500" />
                    Logout
                  </button>
                </div>
              </div>
            )}
          </div>
        </div>
      </header>

      {/* Main Content */}
      <main className="pt-20 px-6">
        {/* Welcome Section */}
        {user && (
          <div className="bg-blue-500 text-white rounded-lg p-6 text-center mb-6 shadow-md">
            <h1 className="text-2xl font-bold">Welcome, {user.name}!</h1>
            <p>Here are your available options:</p>
          </div>
        )}

        {/* Action Grid */}
        <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
          <div
            onClick={() => navigate('/clubs')}
            className="bg-white shadow-lg rounded-lg p-6 text-center cursor-pointer hover:shadow-xl transition"
          >
            <h3 className="text-lg font-bold text-gray-800">View Clubs</h3>
            <p className="text-sm text-gray-600">Manage all your clubs easily.</p>
          </div>
          <div
            onClick={() => navigate('/events')}
            className="bg-white shadow-lg rounded-lg p-6 text-center cursor-pointer hover:shadow-xl transition"
          >
            <h3 className="text-lg font-bold text-gray-800">View Events</h3>
            <p className="text-sm text-gray-600">Stay updated with upcoming events.</p>
          </div>
          <div
            onClick={() => navigate('/resources')}
            className="bg-white shadow-lg rounded-lg p-6 text-center cursor-pointer hover:shadow-xl transition"
          >
            <h3 className="text-lg font-bold text-gray-800">View Resources</h3>
            <p className="text-sm text-gray-600">Access important files and documents.</p>
          </div>
        </div>
      </main>

      {/* Footer */}
      <footer className="bg-gray-800 text-gray-400 text-center py-4 mt-10">
        Â© 2024 My Dashboard. All rights reserved.
      </footer>
    </div>
  );
};

export default Dashboard;
